import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">


            <h5>Welcome in</h5>
        <div className="App-logo" >
            <h1>SRPO</h1>
        </div>
            <h6>Main React App Page </h6>

      </header>
    </div>
  );
}

export default App;
